import './Card.css';
import cardImage from'../../images/51-3.png';

export default function Card() {

  return (
    <li className='card'>
      <a href='#'>
        <img className='card__image' src={cardImage}/>
      </a>
      <div className='card__description-area'>
        <span className='card__price'>9700 &#8381;</span>
        <h2 className='card__header'></h2>
      </div>
      
    </li>
  )
}
